import React, { useState, useEffect } from 'react';
import axios from 'axios';

function MDTList() {
    const [mdts, setMdts] = useState([]); // State to hold MDT data

    useEffect(() => {
        // Fetch data from the backend
        axios.get('http://127.0.0.1:5000/load-mdt-data')
            .then(response => {
                setMdts(response.data); // Update state with fetched data
            })
            .catch(error => {
                console.error('Error fetching MDT data:', error);
            });
    }, []);

    return (
        <div>
            <h2>MDT Inventory</h2>
            <table border="1">
                <thead>
                    <tr>
                        <th>PC Serial</th>
                        <th>PC Model</th>
                        <th>Aircard IP</th>
                        <th>PC Name</th>
                        <th>Term ID</th>
                    </tr>
                </thead>
                <tbody>
                    {mdts.map((mdt, index) => (
                        <tr key={index}>
                            <td>{mdt['PC SERIAL']}</td>
                            <td>{mdt['PC MODEL#']}</td>
                            <td>{mdt['AIRCARD IP']}</td>
                            <td>{mdt['PC NAME']}</td>
                            <td>{mdt['TERM ID']}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
}

export default MDTList;
